import { Component} from "react";
import {Button} from 'antd'
class Square extends Component{
  constructor(props) {
    super(props);
  }
  handleSquare(value){
    alert(value)
  }
  render(){
    return (
      <Button type="primary" type="dashed" size="large" onClick={ ()=>{this.handleSquare(this.props.value)} }>{this.props.value}</Button>
    )
  }
}
export default Square
